Monster Bug Wars

Nature Documentary hosted by Henry Strozier, published by Discovery Channel in 2011 - English narration


Information
------------------------------

Monster Bug Wars
&quot;Monster Bug Wars&quot; takes you ringside to witness some of nature's deadliest encounters-where losers aren't just KO'd, they're eaten alive. This is the no-holds-barred, real-life world of Spiders, Scorpions, Centipedes and Killer Ants who fight to the death. It's a five-episode bug-eat-bug gladiatorial contest where stings, spikes and deadly venom are wielded with cold-blooded precision. Filmed in super close-up high definition and illustrated with state-of-the-art CGI, Monster Bug Wars brings to life nature's ultimate fight club-five encounters per episode-with expert commentary from Cornell University's eminent entomologist, Dr Linda Rayor, and &quot;Professor Poison&quot;, Dr Bryan Grieg Fry from The University of Queensland.


1)  Death At Midnight 
When Rainforest Monsters like the Spiny Leaf Insect and Giant Rainforest Mantis go head-to-head, it's an all-out assault where only one survives. Can the lethal stinger of a Bull Ant overcome the suffocating silk of the Redback Spider? Will the amazing speed of the Water Strider triumph over the stealth and cunning of a Water Spider? Can a black House Spider outpoint its arch-rival, the White-Tailed Spider? And will a cranky, ancient warrior of the spider world - the Sydney Funnel web prevail over it's highly evolved nemesis, the Garden Wolf Spider? When bugs go to war there's just one guarantee - you're either dead or alive.



